import React from 'react';

import DATA from '../../assets/data/AboutMeData.js'

class AboutMe extends React.Component{
    constructor(){
        super()

        this.state={
            profile_data:DATA
        }
    }

    render(){
        const {profile_data} = this.state
        return(
            <div
                style={{
                    backgroundImage:`url(${profile_data.imageUrl})`
                }}
            >
                {profile_data.name}
            </div>
        )
    }
}

export default AboutMe;
